import os
import zipfile
import sys

def list_zip_contents(path):
    # 確保路徑存在
    if not os.path.exists(path):
        print(f"指定的路徑 '{path}' 不存在.")
        return

    # 遞迴檢查每一個檔案和目錄
    for dirpath, dirnames, filenames in os.walk(path):
        for filename in filenames:
            if filename.endswith(".zip"):
                zip_path = os.path.join(dirpath, filename)
                print(f"ZIP 檔案: {zip_path}")
                
                # 打開 zip 檔案並遞迴列出裡面的檔案
                with zipfile.ZipFile(zip_path, 'r') as zip_ref:
                    for name in zip_ref.namelist():
                        print(f"  - {name}")

if __name__ == "__main__":
    # 檢查是否有傳入路徑參數
    if len(sys.argv) < 2:
        print("使用方法: python <這個檔案> <要確認的路徑>")
        sys.exit(1)

    path_to_search = sys.argv[1]
    list_zip_contents(path_to_search)

#include <stdio.h>
#include <string.h>

//Word count
#define WORD_C 3

//Word definitions
#define WORD_S {"Fizz","Buzz","Bizz"}

//Words will be added only to odd numbers in sequence
#define WORD_F i*2+3 

int main() {
	char words[WORD_C][20] = WORD_S;
	int wordc[WORD_C];
	size_t str_size = 0;
	for (int i=0;i < WORD_C;i++) {
		int f = WORD_F;
		wordc[i] = f;
		str_size += strlen(words[i]);
	}
	++str_size;

	char str[str_size];

	for (int i=1;i < 100;i++) {
		strcpy(str,"\0");
		for (int j=0;j < WORD_C;j++) {
			if (i%wordc[j] == 0) {
				strcat(str,words[j]);
			}
		}
		if (strcmp(str,"\0") == 0) {
			printf("%d\n",i);
			continue;
		}
		puts(str);
	}
	return 0;
}

