long int num_input(char data[]) {
    long int num;
    bool successful_conversion;
    
    do {
        if(!fgets(data, MAX_NUM_OF_CHARS, stdin)) {
            return INVALID_INPUT;
        }
        
        char *endpoint;
        
        errno = 0;
        num   = strtol(data, &endpoint, BASE);
        
        if(errno == ERANGE) {
            puts("Det här heltalet är antingen för stort eller för litet");
            successful_conversion = false;
        } else if(endpoint == data) {
            puts("Ge ett heltal som indata:");
            successful_conversion = false;
        } else if(*endpoint && *endpoint != '\n') {
            puts("Ge ett heltal som indata:");
            successful_conversion = false;
        } else {
            successful_conversion = true;
        }
    } while(!successful_conversion);
    
    return num;
}

