node* get_node(node* head, int index) {
    node* n = head;
    
    for(int i = 1; i < index; i++) {
        n = n -> next;
    }
    
    return n;
}

int get_list_length(node* head) {
    int list_length = 0;
    node* n         = head;
    
    while(n != NULL) {
        n = n -> next;
        list_length++;
    }
    
    return list_length;
}

bool verify_if_list_is_empty(node* head) {return get_list_length(head) == 0 ? true: false;}

int* get_list(node* head) {
    node* n      = head;
    int list_len = get_list_length(head);
    int* list    = (int*)malloc(sizeof(int) * list_len);
    
    for(int i = 0; i < list_len; i++) {
        list[i] = n -> el;
        n       = n -> next;
    }
    
    return list;
}

void insert_node(node** head, int index, int num) {
    int list_len    = get_list_length(*head);
    bool list_empty = verify_if_list_is_empty(*head);
    
    node* n = malloc(sizeof(node)); 
    
    if(index > 1 && index <= list_len) {
        node* n_prev   = get_node(*head, index - 1);
        node* temp     = n_prev -> next;
        n_prev -> next = n; 
        n -> next      = temp;
    } else if(index == 1 && list_empty && *head == NULL) {
        *head     = n;
        n -> next = NULL;
    } else if(index == 1) {
        node* temp = *head;
        *head      = n;
        n -> next  = temp;
    } else if(index == list_len + 1) {
        node* n_prev   = get_node(*head, index - 1);
        n_prev -> next = n;
        n -> next      = NULL;
    }
    
    n -> el = num;
}

bool verify_if_num_exists_in_list(node* head, int num) {
    int list_len = get_list_length(head);
    node* n      = head;
    
    for(int i = 0; i < list_len; i++) {
        if(n -> el == num) {
            return true;
        }
        n = n -> next;
    }
    
    return false;
}

int calc_num_index(node* head, int num) {
    int num_index = 1, list_len = get_list_length(head);
    node* n = head;
    
    for(int i = 0; i < list_len; i++) {
        if(n -> el == num) {
            return num_index;
        }
        n = n -> next;
        num_index++;
    }
    
    return INVALID_NUM_INDEX;
}

void delete_node(node** head, int index) {
    int list_len = get_list_length(*head);
    
    if(index > 1 && index < list_len) {
        node* n_del  = get_node(*head, index);
        node* n      = get_node(*head, index);
        node* n_prev = get_node(*head, index - 1);
        
        n_prev -> next = n -> next;
        free(n_del);
    } else if(index == 1) {
        node* n_del = *head;
        *head       = (*head) -> next;
        free(n_del);
    } else if(index == list_len) {
        node* n      = get_node(*head, index);
        node* n_prev = get_node(*head, index - 1);
        
        free(n);
        n_prev -> next = NULL;
    }
}

void delete_all_nodes(node** head) {
    int list_len = get_list_length(*head);
    
    for(int i = 1; i <= list_len; i++) {
        delete_node(head, 1);
    }
}

void swap(node* head, int index1, int index2) {
    node* n1 = get_node(head, index1);
    node* n2 = get_node(head, index2);
    
    int temp = n1 -> el;
    n1 -> el = n2 -> el;
    n2 -> el = temp;
}

void reverse_all_elements_in_list(node* head) {
    int list_len = get_list_length(head), num_of_reverse_operations;
    
    if(list_len % 2 == 0) {
        num_of_reverse_operations = list_len / 2;
    } else {
        num_of_reverse_operations = (list_len - 1) / 2;
    }
    
    for(int i = 1; i <= num_of_reverse_operations; i++) {
        swap(head, i, list_len + 1 - i);
    }
}

int num_max(int num1, int num2) {return num1 >= num2 ? num1: num2;}

void shift_list(node* head, int shift_amount) {
    int list_len       = get_list_length(head);
    const int LIST_LEN = list_len;
    
    
    if(shift_amount > 0) {
        const int SHIFT_AMONT = shift_amount;
        int temp_el[LIST_LEN - SHIFT_AMONT];
        
        for(int i = 1; i <= list_len - SHIFT_AMONT; i++) {
            temp_el[i - 1] = get_node(head, i) -> el;
        }
        
        for(int i = 1; i <= SHIFT_AMONT; i++) {
            node* n1 = get_node(head, i);
            node* n2 = get_node(head, list_len - SHIFT_AMONT + i);
            
            n1 -> el = n2 -> el;
        }
        
        for(int i = SHIFT_AMONT + 1; i <= list_len; i++) {
            node* n = get_node(head, i);
            
            n -> el = temp_el[i - SHIFT_AMONT - 1];
        }
    } else {
        const int SHIFT_AMONT = -shift_amount;
        int temp_el[SHIFT_AMONT];
        
        for(int i = 1; i <= SHIFT_AMONT; i++) {
            temp_el[i - 1] = get_node(head, i) -> el;
        }
        
        for(int i = 1; i <= list_len - SHIFT_AMONT; i++) {
            node* n1 = get_node(head, i);
            node* n2 = get_node(head, SHIFT_AMONT + i);
            
            n1 -> el = n2 -> el;
        }
        
        for(int i = list_len - SHIFT_AMONT + 1; i <= list_len; i++) {
            node* n = get_node(head, i);
            
            n -> el = temp_el[i + SHIFT_AMONT - list_len - 1];
        }
    }
}

void bubble_sort(node* head) {
    int list_len = get_list_length(head);
    node* n      = head;
    
    for(int i = 1; i < list_len; i++) {
        n = head;
        
        for(int j = 1; j < list_len; j++) {
            if(n -> el > (n -> next) -> el) {
                swap(head, j, j + 1);
            }
            
            n = n -> next;
        }
    }
}

