public class MP09_UF2_EJ9 {

    public static void main(String[] args) throws InterruptedException {

        // Variables
        String nombreCaballo;
        int tiempoRecord = 60;
        int opcion = -1;
        Scanner sc = new Scanner(System.in);

        System.out.println("\nBIENVENIDO A APUESTAS HÍPICAS.");
        System.out.println("\n\nUd. es el propietario de un caballo e inicia este juego con 250um.");
        System.out.println("\n\nEl coste para participar en una carrera es de 100um.");
        System.out.println("\nParticipan 7 caballos en total.");
        System.out.println("\nPuede alimentar a su caballo con una manzana mágica");
        System.out.println("\npara aumentar su velocidad. Pudiendo aumentarla hasta un");
        System.out.println("\nmáximo de 5 puntos. El coste de cada manzana mágica es de 100um.");
        System.out.println("\n\nLa carrera puede durar hasta 23 segundos");
        System.out.println("\ny el premio para el ganador es de 250um.");

        // Declarar e inicializar cuenta
        Cuenta cuenta = new Cuenta();
        
        // Pedir nombre del caballo al usuario
        System.out.println("\nIndique el nombre de su caballo:");
        nombreCaballo = sc.nextLine();
        Caballo c1 = new Caballo(nombreCaballo);

        // Declarar e instanciar los demás caballos       
        Caballo c2 = new Caballo("Tokio");
        Caballo c3 = new Caballo("Helsinki");
        Caballo c4 = new Caballo("Nairobi");
        Caballo c5 = new Caballo("Berlin");
        Caballo c6 = new Caballo("Denver");
        Caballo c7 = new Caballo("Rio");

        // Crear menú
        do {
            // Menú
            System.out.println("\n**************");
            System.out.println("---- MENU ----");
            System.out.println("**************");
            System.out.println("1 - Iniciar carrera (-100um).");
            System.out.println("2 - Ver su caballo.");
            System.out.println("3 - Ver su cuenta.");
            System.out.println("4 - Dar manzana mágica (-100um).");
            System.out.println("0 - Salir.");

            System.out.println("\nElija la opción y pulse Intro");
            opcion = sc.nextInt();

            switch (opcion) {
                case 1: // Iniciar carrera
                    if (cuenta.getSaldo() >= 100) {
                        cuenta.pagarCarrera();
                        System.out.println("\nHa pagado 100um para participar en la carrera.");
                        System.out.println("Su saldo actual es de "+cuenta.getSaldo()+"um.");
                        System.out.println("\nEmpieza la carrera!!\n");
                        
                        // Reiniciar tiempo record a 60s
                        tiempoRecord = 60;
                        
                        // Declarar e instanciar los hilos
                        Thread t1 = new Thread(c1); // Convertir caballo 1 en un hilo
                        t1.start(); // Lanzar hilo 1
                        Thread t2 = new Thread(c2); // Convertir caballo 2 en un hilo
                        t2.start(); // Lanzar hilo 2
                        Thread t3 = new Thread(c3); // Convertir caballo 3 en un hilo
                        t3.start(); // Lanzar hilo 3       
                        Thread t4 = new Thread(c4); // Convertir caballo 4 en un hilo
                        t4.start(); // Lanzar hilo 4
                        Thread t5 = new Thread(c5); // Convertir caballo 5 en un hilo
                        t5.start(); // Lanzar hilo 5
                        Thread t6 = new Thread(c6); // Convertir caballo 6 en un hilo
                        t6.start(); // Lanzar hilo 6   
                        Thread t7 = new Thread(c7); // Convertir caballo 7 en un hilo
                        t7.start(); // Lanzar hilo 7   

                        // Ordenar la ejecución de los hilos
                        t1.join();
                        t2.join();
                        t3.join();
                        t4.join();
                        t5.join();
                        t6.join();
                        t7.join();

                        // Hacer un array de caballos
                        Caballo[] caballos = new Caballo[7];
                        // Añadir los caballos
                        caballos[0] = c1;
                        caballos[1] = c2;
                        caballos[2] = c3;
                        caballos[3] = c4;
                        caballos[4] = c5;
                        caballos[5] = c6;
                        caballos[6] = c7;

                        //Hacer array de nombres
                        ArrayList<String> nombres = new ArrayList<>();

                        // Comprobar cuál es el caballo ganador
                        for (Caballo caballo : caballos) {
                            if (caballo.getTiempo() < tiempoRecord) {
                                tiempoRecord = caballo.getTiempo();
                                nombres.add(caballo.getNombre());
                            }
                        }
						
						// El último nombre del array nombres es el ganador
                        String ganador = nombres.get(nombres.size() - 1);

                        System.out.println("\nEl caballo ganador es " + ganador + " con un increíble tiempo de " + tiempoRecord + " segundos");

                        if (c1.getNombre().equalsIgnoreCase(ganador)) {
                            cuenta.cobrarPremio();
                            System.out.println("\n¡Enhorabuena! Ha recibido 250um en su cuenta.");
                        }

                    } else {
                        System.out.println("\n¡No tiene saldo suficiente para participar en la carrera!");
                    }

                    break;
                case 2: // Ver la información de su caballo

                    System.out.println("\nA continuación se indica la información de su caballo.");
                    System.out.println(c1.verInfo());

                    break;
                case 3: // Ver su cuenta
                    System.out.println("\nEl saldo actual de su cuenta es de " + cuenta.getSaldo() + "um.");

                    break;
                case 4: // Dar manzana mágica
                    if (cuenta.getSaldo() >= 100) {
                        cuenta.comprarManzanaMagica();
                        System.out.println("\nHa gastado 100um en comprar una manzana mágica.");
                        System.out.println("Su saldo actual es de "+cuenta.getSaldo()+"um.");
                        if (c1.getVelocidad() < 5) {
                            c1.darManzana();
                            System.out.println("\n" + c1.getNombre() + " se ha comido la manzana y ha aumentado su velocidad en 1 punto.");
                            System.out.println("La velocidad actual de "+c1.getNombre()+" es: "+c1.getVelocidad());
