import java.util.Random;
import java.util.logging.Level;
import java.util.logging.Logger;

public class Caballo implements Runnable {
    
    // Variables
    private Random r = new Random();
    private String name;
    // Definir velocidad inicial aleatoriamente de 1 a 3
    private int velocidad = r.nextInt(3) + 1;
    private int tiempo;
    private int diferencia;
        
    Caballo(String name){
        this.name = name;
    }        
    
    @Override
    public void run() { // Cada vez que se lance el start        
        
        try{
            System.out.println("Sale "+this.name);
            // Obtener un tiempo aleatorio entre 10 y 25 segundos
            diferencia = r.nextInt(10); // Aplicar diferencia aleatoria de 0 a 10 segundos    
            tiempo = diferencia + 15; // Sumar 15 segundos a la diferencia para calcular el tiempo base            
            tiempo -= (velocidad*2); // Reducir al tiempo base el factor velocidad multiplicado por 2 para obtener el tiempo final     
            // Pausar el hilo durante n segundos, siendo n = tiempo
            Thread.sleep(tiempo*1000);
            // Informar al usuario
            System.out.println(""+this.name+" ha llegado a la meta en "+tiempo+" segundos.");
        } catch (InterruptedException ex){
            Logger.getLogger(Caballo.class.getName()).log(Level.SEVERE, null, ex);
        }
                
    }
    
    // GETTERS
    public String getNombre(){
        return this.name;
    }
    
    public int getTiempo(){
        return this.tiempo;
    }
    
    public int getVelocidad(){
        return this.velocidad;
    }
       
    // Método DAR MANZANA MÁGICA para aumentar la velocidad
    public void darManzana(){
        if(this.velocidad<5){
            this.velocidad += 1;
        }        
    }
    
    // Método VER INFORMACIÓN
    public String verInfo(){ // Muestra la información del caballo
        String info = "\nNombre del caballo: " + this.getNombre();
        info += "\nVelocidad: "+ this.getVelocidad();
        return info;
    }
    
}

