def f(n):
    s = ''
    if n >= 0:
        k = n
    if n < 0:
        k = -1 * n    
    while k > 0:
        s += str(k % 6)
        k //= 6
    if n >= 0:
        s = s[::-1]
    if n < 0:
        s = '-' + s[::-1]
    return int(s)
